output = ''

encrypted = [''] * len(output)
i = 0
step = 0
index = 0

while i < len(output):
    encrypted[i:i+8] = output[index:index+8]
    index += 8
    i += step
    step = (step + 1) % 6

encrypted = ''.join(encrypted)

result = []

for i in range(0, len(encrypted), 8):
    result.append(chr(int(''.join(encrypted[i:i+8]), 2)))

encrypted = ''.join(result)

print(encrypted)
